import React from 'react';
import signo from '../signo.png'
import quotes from '../quotes.json'
const Tarjeta = () => {
    return (
        <div>
            <p>{quotes[Math.random(0,quotes.lenght)].quote}</p>
            <button ><img src={signo}></img>
            </button>
        </div>
    );
};

export default Tarjeta;
